def is_undulating(n):
    """
    Checks if a number is undulating.

    An undulating number is a number that increases and then decreases,
    and then increases again.

    Args:
        n: The number to check.

    Returns:
        True if the number is undulating, False otherwise.
    """
    if n < 0:
        return False
    if n == 0:
        return True

    is_increasing = True
    is_decreasing = True

    temp = n
    if temp > 0:
        is_increasing = False
    else:
        is_decreasing = True

    while temp > 0:
        if is_increasing:
            temp = temp - 1
        else:
            temp = temp + 1
        if is_decreasing:
            temp = temp - 1
        else:
            temp = temp + 1

    return is_increasing or is_decreasing
```

