def is_undulating(n):
    """
    Checks whether the given number is undulating or not.

    An undulating number is a number that increases and then decreases,
    and then increases again.

    Args:
        n: The number to check.

    Returns:
        True if the number is undulating, False otherwise.
    """
    if n < 0:
        return False
    if n == 0:
        return True

    is_increasing = True
    is_decreasing = True

    if n > 0:
        for i in range(1, n):
            if i % 2 == 1:
                is_increasing = False
                break
    else:
        for i in range(1, n):
            if i % 2 == 1:
                is_decreasing = False
                break

    if is_increasing and is_decreasing:
        return True
    else:
        return False
