def magic_square_test(my_matrix):
    """
    Calculates the magic square of a given matrix.

    Args:
        my_matrix: A list of lists representing the square matrix.

    Returns:
        The magic square if it exists, otherwise None.
    """
    n = len(my_matrix)
    if n == 0:
        return None
    if n == 1:
        return my_matrix[0]

    magic_constant = n * (n**2 + 1) // 2

    # Check rows
    for row in my_matrix:
        if sum(row) != magic_constant:
            return None

    # Check columns
    for j in range(n):
        column_sum = 0
        for i in range(n):
            column_sum += my_matrix[i][j]
        if column_sum != magic_constant:
            return None

    # Check main diagonal
    main_diagonal_sum = 0
    for i in range(n):
