        return None

    n = len(my_matrix)

    if n == 0:
        return []

    if n != len(my_matrix[0]):
        return None

    magic_constant = n * (n * n + 1) // 2
    magic_square = [[0 for _ in range(n)] for _ in range(n)]

    # Iterate through the matrix to fill the magic square
    for i in range(n):
        for j in range(n):
            magic_square[i][j] = (i + 1) * (j + 1)

    # Check if the magic square is valid
    for i in range(n):
        for j in range(n):
            if magic_square[i][j] != magic_constant:
                return None

    return magic_square
