    if a == 1 and b == -1:
        return (-1, 1)

    if a == -1 and b == 1:
        return (1, -1)

    if a == -1 and b == -1:
        return None

    # Use the quadratic formula to solve for x and y
    x = (-n - b * b) / a
    y = (n - a * x) / b

    return (x, y)
