def is_valid_parenthese(str1):
    """
    Verifies the validity of a string of parentheses.

    Args:
        str1: The string to validate.

    Returns:
        True if the string is valid, False otherwise.
    """
    stack = []
    parenthesis_map = {')': '(', '}': '{', ']': '['}
    for char in str1:
        if char in parenthesis_map.values():
            stack.append(char)
        elif char in parenthesis_map:
            if not stack or stack[-1] != parenthesis_map[char]:
                return False
            stack.pop()
    return not stack
