def binary_search(arr, low, high, x) -> int:
    """
    Given a sorted array arr and two indices low and high, return the index of the first occurrence of x in arr.
    If x is not in arr, return -1.
    """
    while low <= high:
        mid = low + (high - low) // 2
        if arr[mid] == x:
            if mid == low or arr[mid - 1] != x:
                return mid
            else:
                high = mid - 1
        elif arr[mid] < x:
            low = mid + 1
        else:
            high = mid - 1
    return -1
```

