def get_total_number_of_sequences(m,n):
    """
    Finds the number of possible sequences of length n such that each of the next element is greater than or equal to twice of the previous element but less than or equal to m.

    Args:
        m (int): The upper bound for the next element.
        n (int): The length of the sequences.

    Returns:
        int: The number of possible sequences.
    """
    dp = {}

    def solve(index, prev):
        if index == n:
            return 1
        if (index, prev) in dp:
            return dp[(index, prev)]

        count = 0
        for i in range(prev, m + 1):
            count += solve(index + 1, i)

        dp[(index, prev)] = count
        return count

    return solve(0, 0)
```

