def count_binary_seq(n):
    """
    Finds the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits.

    Args:
        n: An integer representing half the length of the binary sequence.

    Returns:
        An integer representing the number of such binary sequences.
    """
    dp = {}

    def solve(index, current_sum, last_bit):
        if index == 2 * n:
            return 1 if current_sum == 0 else 0

        if (index, current_sum, last_bit) in dp:
            return dp[(index, current_sum, last_bit)]

        count = 0
        for bit in range(n + 1):
            new_sum = current_sum + bit
            new_last_bit = last_bit << 1 if bit > 0 else last_bit
            if new_sum <= 2 * n:
                count += solve(index + 1, new_sum, new_last_bit)

        dp[(index, current_sum, last_bit)] = count
        return count

    return solve(0, 0, 0)
