def get_carol(n):
    """
    Calculates the n-th carol number.

    The carol number is defined as the number of ways to choose n items from a set of n items
    without regard to order.  This is equivalent to the binomial coefficient C(n, k),
    where C(n, k) = n! / (k! * (n-k)!).

    Args:
        n: The number of items to choose.

    Returns:
        The n-th carol number.
    """
    if n < 0:
        return 0
    if n == 0:
        return 1
    if n == 1:
        return 1

    def factorial(num):
        if num == 0:
            return 1
        else:
            return num * factorial(num-1)

    return factorial(n) // (factorial(n-1) * factorial(n-1))
```

