    if n < 0:
        return 0
    if n == 0:
        return 1
    if n == 1:
        return 1
    if n == 2:
        return 2
    if n == 3:
        return 5
    if n == 4:
        return 14
    if n == 5:
        return 42

    result = 1
    for i in range(n - 1, -1, -1):
        result = result * (n - i) // (i + 1)
    return result
