def max_Product(arr):
    """
    Finds a pair with the highest product from a given array of integers.

    Args:
        arr: A list of integers.

    Returns:
        A tuple containing the pair with the highest product, or None if the array is empty.
    """
    if not arr:
        return None

    arr.sort()
    product1 = arr[0] * arr[1]
    product2 = arr[-1] * arr[-2]

    if product1 > product2:
        return (arr[0], arr[1])
    else:
        return (arr[-2], arr[-1])
