def count_Occurrence(tup, lst):
    """
    Counts the number of occurrences of all elements of list 'lst' within list 'tup'.

    Args:
        tup: A list.
        lst: A list.

    Returns:
        An integer representing the number of occurrences of each element in 'lst' within 'tup'.
    """
    counts = {}
    for element in tup:
        if element in counts:
            counts[element] += 1
        else:
            counts[element] = 1

    result = []
    for element in lst:
        if element in counts:
            result.append(counts[element])
        else:
            result.append(0)

    return result
```

