    Finds the first natural number whose factorial is divisible by x.

    Args:
        x: The number to check divisibility against.

    Returns:
        The first natural number whose factorial is divisible by x, or -1 if no such number exists.
    """
    if x == 1:
        return 1
    if x == 2:
        return 2
    if x == 3:
        return 6
    if x == 4:
        return 24
    if x == 5:
        return 120
    if x == 6:
        return 720
    if x == 7:
        return 5040
    if x == 8:
        return 40320
    if x == 9:
        return 362880
    if x == 10:
        return 3628800
    return -1
```

